    "2015-09-26T19:49:18.143016",nt"name": "ngdc-marine-trackline-geophysics-database",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains bathymetry, magnetic,
    gravity and seismic shot point navigation data collected during marine cruises from
    1939 to the present. Coverage is worldwide. These data are stored in the MGD77 exchange
    format and are available for download in a variety of user selectable formats. One
