    of the subsequent Data records, containing that part of the data that remains invariant
    throughout the cruise. The Data records present geophysical data (bathymetry, magnetics
    and gravity) and seismic information (shot-point identification) with a corresponding
    time and position. Documentation that varies within the cruise is also included
